let carroIphones = JSON.parse(localStorage.getItem("carroIphones")) || [];
let iphones = JSON.parse(localStorage.getItem("iphones")) || [];
let contenedorCarro = document.getElementById("contenedor-carro");

function mostrarCarro() {
  contenedorCarro.innerHTML = ""
  if (carroIphones.length === 0) {
    const mensajeVacio = document.createElement("h3");
    mensajeVacio.textContent = "Tu carrito esta vacio"
    contenedorCarro.appendChild(mensajeVacio)
    return
  }

  carroIphones.forEach((iphone) => {

    let botonEstado = ""

    if (iphone.stock <= 0) {
      botonEstado = "disabled"
    }

    const divCarro = document.createElement("div");
    divCarro.classList.add("d-flex","flex-wrap","justify-content-between","align-items-center","border","p-3","mb-3","gap-2","colorLetrasCarro")
    divCarro.innerHTML = divCarro.innerHTML =
      `<div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Modelo:</strong> ${iphone.modelo}</div>
        <div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Precio:</strong> ${iphone.precio} USD</div>
        <div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Almacenamiento:</strong> ${iphone.almacenamiento}</div>
        <div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Color:</strong> ${iphone.color}</div>
        <div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Estado:</strong> ${iphone.estado}</div>
        <div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Batería:</strong> ${iphone.bateria}%</div>
        <div class="flex-grow-1 flex-shrink-1  flex-md-auto"><strong>Subtotal:</strong> ${iphone.cantidad * iphone.precio} USD</div>
        <div class="d-flex gap-1 flex-grow-1 flex-shrink-1 flex-md-auto align-items-center">
      <button class="btn btn-sm btn-outline-secondary restar-cantidad" id="${iphone.id}">-</button>
      <span class="mx-2">${iphone.cantidad}</span>
      <button class="btn btn-sm btn-outline-secondary sumar-cantidad" id="${iphone.id}" ${botonEstado}>+</button>
      <button class="btn btn-sm btn-danger eliminar-producto" id="${iphone.id}">Eliminar</button>
    </div>
  `

    contenedorCarro.appendChild(divCarro);
  })

  const contenedorFinal = document.createElement("div");
  contenedorFinal.classList.add ("contenedor-final")

  const botonVaciar = document.createElement("button");
  botonVaciar.textContent = "Vaciar carrito"
  botonVaciar.classList.add("vaciar-carrito")
  botonVaciar.onclick = vaciarCarrito
  
  const sumaPrecios = carroIphones.reduce((contador, iphone) => contador + iphone.precio * iphone.cantidad,0);

  const precioTotal = document.createElement("h3");
  precioTotal.textContent = `Total de la compra: ${sumaPrecios} USD`

  const botonFinalizar = document.createElement("button");
  botonFinalizar.textContent = "Finalizar Compra"
  botonFinalizar.classList.add("boton-finalizar")
  botonFinalizar.id = "finalizarCompra"

  contenedorFinal.appendChild(precioTotal)
  contenedorFinal.appendChild(botonVaciar)
  contenedorFinal.appendChild(botonFinalizar)


  contenedorCarro.appendChild(contenedorFinal)

  document.getElementById("finalizarCompra").addEventListener("click", () => {
    const swalWithBootstrapButtons = Swal.mixin({
      customClass: {
        confirmButton: "btn btn-success",
        cancelButton: "btn btn-danger",
      },
      buttonsStyling: false,
    });
    swalWithBootstrapButtons
      .fire({
        title: "Confirmar compra",
        icon: "info",
        showCancelButton: true,
        confirmButtonText: "Si,terminar compra",
        cancelButtonText: "No,seguir buscando",
        reverseButtons: true,
      })
      .then((result) => {
        if (result.isConfirmed) {
          ventanaModalFinal()
          
        } else if (result.dismiss === Swal.DismissReason.cancel) {
          swalWithBootstrapButtons.fire({
            title: "No finalizaste tu compra",
            text: "Vuelve a ver mas productos",
            icon: "info",
          });
        }
      });
  });

  botonesCarrito(); 
}

function vaciarCarrito() {
  Swal.fire({
    title: "¿Estás seguro?",
    text: "Esta acción vaciará todo el carrito.",
    icon: "warning",
    showCancelButton: true,
    confirmButtonText: "Sí, vaciar",
    cancelButtonText: "Cancelar",
    confirmButtonColor: "#d33",
    cancelButtonColor: "#3085d6",
  }).then((result) => {
    if (result.isConfirmed) {
      carroIphones.forEach((iphonesEnCarro) => {const stockInicial = iphones.find((iphone) => iphone.id === iphonesEnCarro.id)
        if (stockInicial) {
          stockInicial.stock += iphonesEnCarro.cantidad
        }
      })

      localStorage.removeItem("carroIphones")
      carroIphones = []
      contenedorCarro.innerHTML = ""

     localStorage.setItem("iphones", JSON.stringify(iphones))

      mostrarCarro();

      Swal.fire({
        icon: "success",
        title: "Carrito vaciado",
        text: "Todos los productos fueron eliminados.",
        confirmButtonColor: "#178582",
      })
    }
  })
}

mostrarCarro();



function botonesCarrito() {
 const botonesSumar = document.querySelectorAll(".sumar-cantidad");
  botonesSumar.forEach((boton) => {boton.addEventListener("click", (e) => {
      const id = parseInt(e.target.id);
      const productoElegido = carroIphones.find((iphone) => iphone.id === id);
      const stockOriginal = iphones.find((iphone) => iphone.id === id);

      if (productoElegido && stockOriginal && stockOriginal.stock > 0) {
        productoElegido.cantidad++
        stockOriginal.stock--

        localStorage.setItem("carroIphones", JSON.stringify(carroIphones))
        localStorage.setItem("iphones", JSON.stringify(iphones))
        mostrarCarro(carroIphones)
        
      }
    })
  })

  const botonesRestar = document.querySelectorAll(".restar-cantidad");
  botonesRestar.forEach((boton) => {boton.addEventListener("click", (e) => {
      const id = parseInt(e.target.id);
      const productoElegido = carroIphones.find((iphone) => iphone.id === id);
      const stockOriginal = iphones.find((iphone) => iphone.id === id);

      if (productoElegido && stockOriginal) {
        if (productoElegido.cantidad > 1) {
          productoElegido.cantidad--
          stockOriginal.stock++
        } else {
          carroIphones = carroIphones.filter((iphone) => iphone.id !== id)
          stockOriginal.stock++ 
        }

        localStorage.setItem("carroIphones", JSON.stringify(carroIphones))
        localStorage.setItem("iphones", JSON.stringify(iphones))

       mostrarCarro(carroIphones)
        
      }
    })
  })

  const botonesEliminar = document.querySelectorAll(".eliminar-producto");
  botonesEliminar.forEach((boton) => {boton.addEventListener("click", (e) => {
      const id = parseInt(e.target.id);
      const productoElegido = carroIphones.find((iphone) => iphone.id === id);
      const stockOriginal = iphones.find((iphone) => iphone.id === id);

      if (productoElegido && stockOriginal) {
        stockOriginal.stock += productoElegido.cantidad
        carroIphones = carroIphones.filter((iphone) => iphone.id !== id)

        localStorage.setItem("carroIphones", JSON.stringify(carroIphones))
        localStorage.setItem("iphones", JSON.stringify(iphones))
        mostrarCarro(carroIphones)
        
      }
    })
  })
}


function ventanaModalFinal() {
  const modal = new bootstrap.Modal(document.getElementById('modalCompra'));
  modal.show()

  const resumenProductos = document.getElementById("resumenProductos");
  const totalCompra = document.getElementById("totalCompra");

  resumenProductos.innerHTML = ""

  carroIphones.forEach(iphone => {
    const item = document.createElement("li");
    item.classList.add("list-group-item")
    item.textContent = `${iphone.modelo} - ${iphone.cantidad} - $ ${iphone.precio}`
    resumenProductos.appendChild(item)
    
  })
  const sumaPrecios = carroIphones.reduce((contador, iphone) => contador + iphone.precio * iphone.cantidad,0);
  totalCompra.textContent = `$${sumaPrecios}`

  
}

document.getElementById("metodoPago").addEventListener("change", function () {
  const metodo = this.value;
  const datosTarjeta = document.getElementById("datosTarjeta");
  const datosTransferencia = document.getElementById("datosTransferencia");

  if (metodo === "credito" || metodo === "debito") {
    datosTarjeta.style.display = "block"
  } else {
    datosTarjeta.style.display = "none"
  }

  if (metodo === "transferencia") {
    datosTransferencia.style.display = "block"
  } else {
    datosTransferencia.style.display = "none"
  }
})

document.getElementById("formCompra").addEventListener("submit", function (evento) {
    evento.preventDefault();

    const campoNombre = document.getElementById("nombre");
    const campoDni = document.getElementById("dni");
    const campoEmail = document.getElementById("email");
    const campoProvincia = document.getElementById("provincia");
    const campoDireccion = document.getElementById("direccion");
    const campoMetodoPago = document.getElementById("metodoPago");
    const campoNumeroTarjeta = document.getElementById("numeroTarjeta");
    const campoNombreTarjeta = document.getElementById("nombreTarjeta");
    const metodoPago = campoMetodoPago.value;

    const soloLetrasYEspacios = /^[A-Za-zÁÉÍÓÚáéíóúÑñ\s]+$/;
    const soloNumeros = /^\d+$/;
    const formatoEmail = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

    let todoCorrecto = true;

    function validarCampos(condicion, campo) {
      if (!condicion) {
        campo.classList.add("is-invalid")
        todoCorrecto = false
      } else {
        campo.classList.remove("is-invalid")
      }
    }

    validarCampos(soloLetrasYEspacios.test(campoNombre.value.trim()),campoNombre);
    validarCampos(soloNumeros.test(campoDni.value.trim()), campoDni);
    validarCampos(formatoEmail.test(campoEmail.value.trim()), campoEmail);
    validarCampos(soloLetrasYEspacios.test(campoProvincia.value.trim()),campoProvincia);
    validarCampos(campoDireccion.value.trim().length >= 5, campoDireccion);
    validarCampos(metodoPago !== "", campoMetodoPago);

    if (metodoPago === "credito" || metodoPago === "debito") {
      const soloNumeros16 = /^\d{16}$/;
      validarCampos(soloNumeros16.test(campoNumeroTarjeta.value.trim()),campoNumeroTarjeta);
      validarCampos(soloLetrasYEspacios.test(campoNombreTarjeta.value.trim()),campoNombreTarjeta);
    }

    if (todoCorrecto) {
      const datosPersona = {
        nombre: campoNombre.value.trim(),
        dni: campoDni.value.trim(),
        email: campoEmail.value.trim(),
        provincia: campoProvincia.value.trim(),
        direccion: campoDireccion.value.trim(),
        metodoPago: metodoPago,
      }

      localStorage.setItem("datosCompra", JSON.stringify(datosPersona))

      generarPDF(datosPersona);


      const modal = bootstrap.Modal.getInstance(document.getElementById("modalCompra"));
      modal.hide();

      setTimeout(() => {
        Swal.fire({
          title: "Compra exitosa!",
          text: "Gracias por tu compra.",
          icon: "success",
          confirmButtonText: "Aceptar",
        }).then(() => {
          localStorage.removeItem("carroIphones")
          localStorage.removeItem("datosCompra")

          carroIphones = [];

         mostrarCarro();
        })
      }, 300)

    }
  })




function generarPDF(datosCompra) {
  const { jsPDF } = window.jspdf;
  const pdf = new jsPDF();
  const logo = "data:image/png;base64,";


  pdf.addImage(logo,"PNG",120,10,80,80)
  pdf.setFontSize(16)
  pdf.text("Comprobante de Compra", 20, 20)

  pdf.setFontSize(12)
  pdf.text(`Nombre: ${datosCompra.nombre}`, 20, 40)
  pdf.text(`DNI: ${datosCompra.dni}`, 20, 50)
  pdf.text(`Email: ${datosCompra.email}`, 20, 60)
  pdf.text(`Provincia: ${datosCompra.provincia}`, 20, 70)
  pdf.text(`Direccion: ${datosCompra.direccion}`, 20, 80)
  

  const productos = JSON.parse(localStorage.getItem("carroIphones"));
  let y = 100;
  let total = 0;

  pdf.text("Productos:", 20, y)
  y += 10

  productos.forEach((producto) => {
    pdf.text(`Cantidad ${producto.cantidad}- ${producto.modelo} - ${producto.precio * producto.cantidad}USD`,20,y);
    total += producto.precio * producto.cantidad
    y += 10
  })

  pdf.text(`Total: ${total} USD`, 20, y + 10)
  pdf.text(`Metodo de pago elegido: ${datosCompra.metodoPago}`, 20, y + 20)
  y += 30

  if (datosCompra.metodoPago === "transferencia") {
    pdf.setFontSize(12);
    pdf.text("Datos para Transferencia:", 20, y);
    y += 10;
    pdf.text("alias: ISELECT.BV", 20, y);
    y += 10;
    pdf.text("CBU:1234567890123456789012 ", 20, y);
  }
  
  pdf.save("comprobante-ISELECTBV.pdf");
  
}

  

  


